import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to appear (by class)
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Take screenshot of product grid (if present)
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_2_products_grid.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_products_grid.png'));
    }

    // Extract all product prices from all visible .product-price elements
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => node.textContent.trim())
    );

    // Also try to extract prices from product detail modal if any
    let modalPrices = [];
    const modalVisible = await page.$('#productModal');
    if (modalVisible) {
      const isDisplayed = await modalVisible.evaluate(el => {
        return window.getComputedStyle(el).display !== 'none';
      });
      if (isDisplayed) {
        modalPrices = await page.$$eval('#productModal .product-detail-price', nodes =>
          nodes.map(node => node.textContent.trim())
        );
      }
    }

    // Combine and deduplicate prices
    const allPrices = Array.from(new Set([...prices, ...modalPrices]));

    // Take a screenshot of the first product card (if present)
    const firstProductCard = await page.$('.product-card');
    if (firstProductCard) {
      await firstProductCard.screenshot({ path: path.join(screenshotsDir, 'step_3_first_product_card.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_first_product_card.png'));
    }

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        productPrices: allPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
